export enum ScreenSize {
    "xs" = 0,
    "sm" = 1,
    "md" = 2,
    "lg" = 3,
    "xl" = 4,
    "xxl" = 5
}

export const seeIfLogin = async (api, setToken, OpenPage, cb?) => {
    const email = localStorage.getItem('email')
    const password = localStorage.getItem('password')
    if (email !== null && email !== '') {
        try {
            const body = await api.login({email: email, password: password})
            setToken(body.data).then(() => {
                cb()
            })
        } catch (err) {
            console.error(err)
        }
    } else {
        OpenPage('/')
    }
}
